package com.example.auta.domain.entities;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.time.LocalDate;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class ReservationEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private LocalDate reservationDate;    @ManyToOne    private CustomerEntity customer;    @OneToOne    private CarEntity car;    private LocalDate rentalStartDate;    private LocalDate rentalEndDate;    @ManyToOne    private BranchEntity rentalBranch;    @ManyToOne    private BranchEntity returnBranch;    private BigDecimal totalPrice;}